import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import './Projects.css';

export class Projects extends Component {
     render() {   
    return (
        <section id="Projects" >

        <div className="projects-style"> 

        <h1 className="projects-h1" > Projects </h1>
                <div className="projects-stories" > 
               <Link to="/Gallery"> <h3 className="stories-text" >  Stories  </h3> </Link>
                  </div>

            <div className="projects-ideas" >
               <h3 className="ideas-text" > Project Ideas </h3> 
                  </div>

            <div className="projects-photography" >
                <h3 className="photography-text" > photography </h3>
                  </div>

            <div className="projects-film" >
                 <h3 className="film-text" > Films/ movies </h3>
                  </div>
        </div>
        </section>
    )
}}

export default Projects
